contracts/ExoSupermarche.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

contract supermarche {

    struct produit {
        uint _id;
        string _libelle;
        int16 _prix;
    }

    struct client {
        uint _id;
        string _nom;
        produit[] _panier;
    }

    produit[] produits;

    function createProduit(string memory _libelle, int16 _prix) public {
        uint id = produits.length + 1;
        produit memory p = produit(id, _libelle, _prix);
        produits.push(p);
    }

    function getAllProducts() public view returns(produit[] memory) {
        return produits;
    }




}

